import React from 'react'
import $ from 'jquery'
import PostView from './PostView'


export default props => {

    const [posts, setPosts] = React.useState({})

    function getPosts() {
        $.get(props.api + '/sayHello?name=Gustavo', r => {
            console.log(r)
        })
    }

    React.useEffect(() => {
        getPosts()
    }, [posts])

    return (
        <div className="Posts">
            <PostView postName="something"/>
            <PostView postName="something 2"/>
            <PostView postName="something 3"/>
        </div>
    )

}
